/strong></span><strong><span style=\"font-family: arial,helvetica,sans-serif;\">@#20</span></strong></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Ch</strong></span>ủ đề tuyển dụng:&nbsp;<span style=\"font-family: arial,helvetica,sans-serif;\"><strong> </strong></span><strong><span style=\"font-family: arial,helvetica,sans-serif;\">@#21</span></strong><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><br /></strong></span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>2.&nbsp;&nbsp;&nbsp; </strong><strong>Ho&agrave;n thiện Hồ sơ:</strong></span></p>\r\n<ol> </ol>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></span><span style=\"font-family: arial,helvetica,sans-serif;\"><strong></strong><strong>Thời gian hoàn thành h&ocirc;̀ sơ trước ngày :</strong> @#12</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>Danh mục Hồ sơ cần ho&agrave;n thiện bao gồm:</strong></span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Sơ yếu l&yacute; lịch c&oacute; x&aacute;c nhận của ch&iacute;nh quyền địa phương (kh&ocirc;ng qu&aacute; 3 th&aacute;ng)</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Bản sao giấy khai sinh</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + 03 Bản sao Chứng minh nh&acirc;n d&acirc;n (c&oacute; c&ocirc;ng chứng)</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Bảo sao sổ hộ khẩu (kh&ocirc;ng cần c&ocirc;ng chứng)</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Giấy chứng nhận sức khỏe</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Bản sao c&aacute;c văn bằng chứng chỉ li&ecirc;n quan (c&oacute; c&ocirc;ng chứng)</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + 4 ảnh 3&nbsp; x&nbsp; 4</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Giấy bảo l&atilde;nh tr&aacute;ch nhiệm d&acirc;n sự (<strong>download tại đ&acirc;y</strong>)</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;3<strong>.&nbsp;&nbsp;&nbsp; </strong><strong>Nhận việc:</strong></span></p>\r\n<ol> </ol>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + </strong><strong>Thời gian:</strong> 8h ng</span>&agrave;y <span style=\"font-family: arial,helvetica,sans-serif;\">@#12</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + </strong><strong>Địa điểm:</strong> @#13</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\">Chú ý: Ứng vi&ecirc;n phải phản h&ocirc;̀i lại thư trong vòng 1 tu&acirc;̀n đ&ecirc;̉ ch&acirc;́p nh&acirc;n trúng tuy&ecirc;̉n.</span></p>'),
