('BBTT', 'BIÊN BẢN THỎA THUẬN', '<table style=\"width: 700px;\" border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\" colspan=\"6\"><span style=\"font-size: medium;\">CỘNG HO&Agrave; X&Atilde; HỘI CHỦ NGHĨA VIỆT NAM</span><br /><span style=\"font-size: small;\">ĐỘC LẬP-TỰ DO- HẠNH PH&Uacute;C</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" colspan=\"6\"><br />*** <br /><span style=\"font-size: large;\"><strong>BI&Ecirc;N BẢN THỎA THUẬN&nbsp;</strong></span> <br /><strong><span style=\"font-size: small;\">Số TT: #contractid#&nbsp;</span></strong><br /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"6\">\r\n<p>- Căn cứ v&agrave;o chức năng, nhiệm vụ v&agrave; khả năng sản xuất của đ&ocirc;i b&ecirc;n.</p>\r\n<p><strong>H&ocirc;m nay, ng&agrave;y #startday# th&aacute;ng #startmonth# năm #startyear#, tại Văn ph&ograve;ng C&ocirc;ng ty TNHH Vĩ An. Ch&uacute;ng t&ocirc;i gồm c&oacute;:&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"130\"><strong><span style=\"text-decoration: underline;\">B&Ecirc;N A (B&ecirc;n b&aacute;n)</span></strong></td>\r\n<td width=\"3\">:</td>\r\n<td colspan=\"4\"><strong>C&Ocirc;NG TY TNHH VĨ AN (B&ecirc;n giao gia c&ocirc;ng)</strong></td>\r\n</tr>\r\n<tr>\r\n<td>- Địa chỉ</td>\r\n<td>:</td>\r\n<td colspan=\"4\">L&ocirc; III-21, Đường 19/5A, CN III, KCN T&acirc;n B&igrave;nh, P. T&acirc;y Thạnh, Q. T&acirc;n Ph&uacute;, TP. HCM</td>\r\n</tr>\r\n<tr>\r\n<td>- Điện thoại</td>\r\n<td>:</td>\r\n<td width=\"203\">08.3816.3228</td>\r\n<td width=\"72\">Fax</td>\r\n<td width=\"3\">:</td>\r\n<td width=\"99\">08.3816.3229</td>\r\n</tr>\r\n<tr>\r\n<td>- Người đại diện</td>\r\n<td>:</td>\r\n<td><strong>T&Ocirc; QUẢNG HUY</strong></td>\r\n<td>Chức vụ</td>\r\n<td>:</td>\r\n<td>Gi&aacute;m đốc</td>\r\n</tr>\r\n<tr>\r\n<td>- M&atilde; số thuế</td>\r\n<td>:</td>\r\n<td colspan=\"4\">0 3 0 1 7 7 4 6 7 0&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width=\"130\"><strong><span style=\"text-decoration: underline;\">B&Ecirc;N B (B&ecirc;n mua)</span></strong></td>\r\n<td width=\"3\">:</td>\r\n<td colspan=\"4\"><strong> @01 </strong></td>\r\n</tr>\r\n<tr>\r\n<td>Địa chỉ</td>\r\n<td>:</td>\r\n<td colspan=\"4\" align=\"justify\">@02</td>\r\n</tr>\r\n<tr>\r\n<td>Điện thoại</td>\r\n<td>:</td>\r\n<td width=\"203\">@03</td>\r\n<td width=\"72\">Fax</td>\r\n<td width=\"3\">:</td>\r\n<td width=\"99\">@04</td>\r\n</tr>\r\n<tr>\r\n<td>M&atilde; số thuế</td>\r\n<td>:</td>\r\n<td colspan=\"4\">@05</td>\r\n</tr>\r\n<tr>\r\n<td>Số t&agrave;i khoản</td>\r\n<td>:</td>\r\n<td colspan=\"4\" align=\"justify\">@06</td>\r\n</tr>\r\n<tr>\r\n<td>Người đại diện</td>\r\n<td>:</td>\r\n<td><strong>@07</strong></td>\r\n<td>Chức danh</td>\r\n<td>:</td>\r\n<td>@08</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td colspan=\"4\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"6\" align=\"justify\"><em>Sau khi thoả thuận B&ecirc;n B nhất tr&iacute; nhận may gia c&ocirc;ng cho B&ecirc;n A thuộc c&aacute;c m&atilde; h&agrave;ng sau:</em></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 700px;\" border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td width=\"68\">&nbsp;</td>\r\n<td width=\"6\">&nbsp;</td>\r\n<td width=\"116\">&nbsp;</td>\r\n<td width=\"178\">&nbsp;</td>\r\n<td width=\"21\">&nbsp;</td>\r\n<td width=\"5\">&nbsp;</td>\r\n<td width=\"108\">&nbsp;</td>\r\n<td width=\"31\">&nbsp;</td>\r\n<td width=\"59\">&nbsp;</td>\r\n<td width=\"66\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 1:</span></strong></td>\r\n<td colspan=\"9\"><strong>MẶT H&Agrave;NG, SỐ LƯỢNG, ĐƠN GI&Aacute;</strong></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\"><!--strAttack--></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\">Đơn gi&aacute; tr&ecirc;n đơn thuần May, cắt chỉ, kiểm, ph&iacute; bốc v&aacute;c, ph&iacute; vận chuyển &hellip; .</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 2:</span></strong></td>\r\n<td colspan=\"9\" align=\"justify\"><span style=\"font-weight: bold; text-align: start;\">NGUY&Ecirc;N PHỤ LIỆU</span></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\">\r\n<p style=\"text-align: justify;\"><br /> -&nbsp;Sau khi B&ecirc;n A triển khai, B&ecirc;n B nhận vải, phụ liệu, t&agrave;i liệu kỹ thuật tại kho B&ecirc;n A v&agrave; tự kiểm tra &nbsp;lượng, chất lượng so với Phiếu xuất kho. B&ecirc;n B may 02 &aacute;o mẫu cho B&ecirc;n A duyệt trước khi may h&agrave;ng v&agrave; phải trả lại mẫu gốc cho B&ecirc;n A trong v&ograve;ng 07 ng&agrave;y kể từ ng&agrave;y mượn, nếu B&ecirc;n B kh&ocirc;ng trả lại sẽ bị khấu trừ 1.000.000VND/mẫu. B&ecirc;n B phải chịu tr&aacute;ch nhiệm về Nguy&ecirc;n phụ liệu từ khi tiếp nhận đến sau khi giao h&agrave;ng v&agrave; thanh l&yacute; đơn h&agrave;ng, kh&ocirc;ng được giao Nguy&ecirc;n phụ liệu cho B&ecirc;n thứ 3 trong bất kỳ điều kiện n&agrave;o khi chưa c&oacute; &yacute; kiến của B&ecirc;n A.</p>\r\n<p style=\"text-align: justify;\">- Nếu ph&aacute;t hiện Nguy&ecirc;n phụ liệu kh&ocirc;ng đạt số lượng v&agrave; chất lượng, B&ecirc;n B phải giữ lại nguy&ecirc;n tem, nguy&ecirc;n kiện để b&aacute;o ngay cho B&ecirc;n A trong v&ograve;ng 02 ng&agrave;y để kịp thời giải quyết. Sau 02 ng&agrave;y B&ecirc;n B kh&ocirc;ng b&aacute;o cho B&ecirc;n A th&igrave; mọi mất m&aacute;t, thiếu hụt B&ecirc;n B tự chịu tr&aacute;ch nhiệm (trừ thay th&acirc;n, lỗi sợi). Đối với Nguy&ecirc;n phụ liệu thừa &nbsp;B&ecirc;n B phải xuất trả cho B&ecirc;n A trong v&ograve;ng 07 ng&agrave;y sau đợt xuất h&agrave;ng cuối c&ugrave;ng. Nếu kh&ocirc;ng xuất trả đầy đủ số Nguy&ecirc;n phụ liệu thừa đ&oacute; cho B&ecirc;n A th&igrave; B&ecirc;n B phải thanh to&aacute;n cho B&ecirc;n A theo gi&aacute; Nguy&ecirc;n phụ liệu ngoại nhập. B&ecirc;n B phải thực hiện đ&uacute;ng nguy&ecirc;n tắc về ph&ograve;ng ch&aacute;y chữa ch&aacute;y v&agrave; quy định về bảo vệ t&agrave;i sản do nh&agrave; nước ban h&agrave;nh. Nếu B&ecirc;n B kh&ocirc;ng thực hiện đ&uacute;ng th&igrave; B&ecirc;n B phải bồi thường thiệt hại to&agrave;n bộ gi&aacute; trị đơn h&agrave;ng khi xảy ra sự cố.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 3:</span></strong></td>\r\n<td colspan=\"9\"><strong>CHẤT LƯỢNG TH&Agrave;NH PHẨM - NG&Agrave;Y GIAO H&Agrave;NG</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify;\" colspan=\"10\"><br /> - B&ecirc;n B chịu tr&aacute;ch nhiệm cuối c&ugrave;ng về ng&agrave;y giao h&agrave;ng, th&ocirc;ng số kỹ thuật, chất lượng, số lượng v&agrave; tất cả những khiếu nại y&ecirc;u cầu bồi thường của kh&aacute;ch h&agrave;ng (nếu c&oacute;). Nếu B&ecirc;n B giao h&agrave;ng trễ, thiếu số lượng, k&eacute;m chất lượng th&igrave; B&ecirc;n B sẽ chịu mọi chi ph&iacute; vận chuyển bằng m&aacute;y bay c&ugrave;ng ph&iacute; bảo hiểm h&agrave;ng ho&aacute; v&agrave; c&aacute;c khoản tiền phạt bồi thường thiệt hại cho kh&aacute;ch h&agrave;ng của B&ecirc;n A. Khi h&agrave;ng đ&atilde; xuất sang nước ngo&agrave;i m&agrave; kh&aacute;ch h&agrave;ng b&aacute;o lại bằng Văn bản: Debit memo (Invoice #... ) l&agrave; h&agrave;ng kh&ocirc;ng đạt chất lượng th&igrave; B&ecirc;n A sẽ căn cứ v&agrave;o Văn bản của kh&aacute;ch h&agrave;ng trừ tiền B&ecirc;n B. Số tiền đ&oacute; sẽ được cấn trừ trong đợt thanh to&aacute;n gia c&ocirc;ng gần nhất.<span style=\"white-space: pre; \"> </span><br /></td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 4:</span></strong></td>\r\n<td colspan=\"9\"><strong>PHƯƠNG THỨC THANH TO&Aacute;N:</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify;\" colspan=\"10\"><br /> - B&ecirc;n A thanh to&aacute;n cho B&ecirc;n B sau khi trừ tất cả c&aacute;c chi ph&iacute; ph&aacute;t sinh (nếu c&oacute;), trong v&ograve;ng 30 ng&agrave;y kể từ ng&agrave;y nhận h&agrave;ng v&agrave; Ho&aacute; đơn B&aacute;n H&agrave;ng c&ugrave;ng Phiếu xuất nhập kho. Khi B&ecirc;n B giao th&agrave;nh phẩm th&igrave; B&ecirc;n B phải cung cấp phiếu xuất khi cho B&ecirc;n A. Nếu xuất h&agrave;ng &nbsp;m&agrave; b&ecirc;n B kh&ocirc;ng giao xuất kho th&igrave; việc thiếu hụt số lượng B&ecirc;n B ho&agrave;n to&agrave;n chịu tr&aacute;ch nhiệm v&agrave; phải chịu khấu trừ v&agrave;o tiền gia c&ocirc;ng khi thanh to&aacute;n.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 5:</span></strong></td>\r\n<td colspan=\"9\"><strong>ĐIỀU KHOẢN CHUNG.</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify; \" colspan=\"10\"><br /> - Hai &nbsp;b&ecirc;n cam kết thi h&agrave;nh đ&uacute;ng v&agrave; đầy đủ c&aacute;c diều khoản đ&atilde; thoả thuận. Sau &nbsp;khi đồng &yacute; nhận may đơn h&agrave;ng, B&ecirc;n B phải đẩm bảo giao h&agrave;ng theo ng&agrave;y đ&atilde; thoả thuận v&agrave; kh&ocirc;ng được trả lại h&agrave;ng sau khi đ&atilde; k&yacute; thoả thuận. Nếu B&ecirc;n B trả lại đơn h&agrave;ng th&igrave; B&ecirc;n B sẽ phải bồi thường theo đ&uacute;ng gi&aacute; trị l&ocirc; h&agrave;ng. Mọi sự thay đổi bổ sung đều phải được x&aacute;c nhận bằng văn bản giữa hai b&ecirc;n.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify;\" colspan=\"10\"><br />- Trong qu&aacute; tr&igrave;nh thực hiện thoả thuận nếu c&oacute; ph&aacute;t sinh vấn đề kh&oacute; khăn cho một trong hai b&ecirc;n th&igrave; phải cung nhau b&agrave;n bạc giải quyết tr&ecirc;n tinh thần hợp t&aacute;c nhằm thực hiện tốt thoả thuận n&agrave;y theo ph&aacute;p luật Việt Nam.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 700px;\" border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"30\">&nbsp;</td>\r\n<td width=\"80\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"85\">&nbsp;</td>\r\n<td width=\"28\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><strong>ĐẠI DIỆN B&Ecirc;N A<br /> </strong></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><strong>ĐẠI DIỆN B&Ecirc;N B<br /> </strong></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><em>(K&yacute; t&ecirc;n)</em></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><em>(K&yacute; t&ecirc;n)</em></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><em>Ghi r&otilde; họ v&agrave; t&ecirc;n</em></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><em>Ghi r&o