('HDGC', 'HỢP ĐỒNG GIA CÔNG', '<table style=\"width: 700px;\" border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\" colspan=\"6\"><span style=\"font-size: medium;\">CỘNG HO&Agrave; X&Atilde; HỘI CHỦ NGHĨA VIỆT NAM</span><br /><span style=\"font-size: small;\">ĐỘC LẬP-TỰ DO- HẠNH PH&Uacute;C</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" colspan=\"6\"><br />*** <br /><span style=\"font-size: large;\"><strong>HỢP ĐỒNG GIA C&Ocirc;NG </strong></span> <br /><strong><span style=\"font-size: small;\">Số HĐ: #contractid#</span></strong><br /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"6\">\r\n<p>- Căn cứ bộ luật d&acirc;n sự số 33/2005/QH11 được Quốc Hội th&ocirc;ng qua ng&agrave;y 14/06/2005 <br /> - Căn cứ Luật Thương Mại số 36/2005/QH11 được Quốc Hội th&ocirc;ng qua ng&agrave;y 14/06/2005<br /> - Căn cứ v&agrave;o chức năng, nhiệm vụ v&agrave; khả năng sản xuất của đ&ocirc;i b&ecirc;n,</p>\r\n<p><strong>H&ocirc;m nay, ng&agrave;y #startday# th&aacute;ng #startmonth# năm #startyear#. Ch&uacute;ng t&ocirc;i gồm c&oacute;:</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"130\"><strong><span style=\"text-decoration: underline;\">B&Ecirc;N A (B&ecirc;n b&aacute;n)</span></strong></td>\r\n<td width=\"3\">:</td>\r\n<td colspan=\"4\"><strong>C&Ocirc;NG TY TNHH VĨ AN (B&ecirc;n giao gia c&ocirc;ng)</strong></td>\r\n</tr>\r\n<tr>\r\n<td>- Địa chỉ</td>\r\n<td>:</td>\r\n<td colspan=\"4\">L&ocirc; III-21, Đường 19/5A, CN III, KCN T&acirc;n B&igrave;nh, P. T&acirc;y Thạnh, Q. T&acirc;n Ph&uacute;, TP. HCM</td>\r\n</tr>\r\n<tr>\r\n<td>- Điện thoại</td>\r\n<td>:</td>\r\n<td width=\"203\">08.3816.3228</td>\r\n<td width=\"72\">Fax</td>\r\n<td width=\"3\">:</td>\r\n<td width=\"99\">08.3816.3229</td>\r\n</tr>\r\n<tr>\r\n<td>- Người đại diện</td>\r\n<td>:</td>\r\n<td><strong>T&Ocirc; QUẢNG HUY</strong></td>\r\n<td>Chức vụ</td>\r\n<td>:</td>\r\n<td>Gi&aacute;m đốc</td>\r\n</tr>\r\n<tr>\r\n<td>- M&atilde; số thuế</td>\r\n<td>:</td>\r\n<td colspan=\"4\">0 3 0 1 7 7 4 6 7 0&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width=\"130\"><strong><span style=\"text-decoration: underline;\">B&Ecirc;N B (B&ecirc;n mua)</span></strong></td>\r\n<td width=\"3\">:</td>\r\n<td colspan=\"4\"><strong> @01 </strong></td>\r\n</tr>\r\n<tr>\r\n<td>Địa chỉ</td>\r\n<td>:</td>\r\n<td colspan=\"4\" align=\"justify\">@02</td>\r\n</tr>\r\n<tr>\r\n<td>Điện thoại</td>\r\n<td>:</td>\r\n<td width=\"203\">@03</td>\r\n<td width=\"72\">Fax</td>\r\n<td width=\"3\">:</td>\r\n<td width=\"99\">@04</td>\r\n</tr>\r\n<tr>\r\n<td>M&atilde; số thuế</td>\r\n<td>:</td>\r\n<td colspan=\"4\">@05</td>\r\n</tr>\r\n<tr>\r\n<td>Số t&agrave;i khoản</td>\r\n<td>:</td>\r\n<td colspan=\"4\" align=\"justify\">@06</td>\r\n</tr>\r\n<tr>\r\n<td>Người đại diện</td>\r\n<td>:</td>\r\n<td><strong>@07</strong></td>\r\n<td>Chức danh</td>\r\n<td>:</td>\r\n<td>@08</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td colspan=\"4\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"6\" align=\"justify\"><em>Sau khi b&agrave;n bạc v&agrave; thoả thuận, hai b&ecirc;n nhất tr&iacute; k&yacute; hợp đồng gia c&ocirc;ng May h&agrave;ng xuất khẩu với c&aacute;c điều&nbsp;</em></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 700px;\" border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td width=\"68\">&nbsp;</td>\r\n<td width=\"6\">&nbsp;</td>\r\n<td width=\"116\">&nbsp;</td>\r\n<td width=\"178\">&nbsp;</td>\r\n<td width=\"21\">&nbsp;</td>\r\n<td width=\"5\">&nbsp;</td>\r\n<td width=\"108\">&nbsp;</td>\r\n<td width=\"31\">&nbsp;</td>\r\n<td width=\"59\">&nbsp;</td>\r\n<td width=\"66\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 1:</span></strong></td>\r\n<td colspan=\"9\"><strong>MẶT H&Agrave;NG, SỐ LƯỢNG, ĐƠN GI&Aacute;</strong></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\"><br />B&ecirc;n A đặt giao b&ecirc;n B gia c&ocirc;ng h&agrave;ng. Theo đ&oacute;, b&ecirc;n A sẽ nhập khẩu nguy&ecirc;n phụ liệu cho b&ecirc;n B để thực hiện gia c&ocirc;ng c&aacute;c m&atilde; h&agrave;ng v&agrave; đơn gi&aacute; được tr&igrave;nh b&agrave;y theo c&aacute;c phụ kiện đ&iacute;nh k&egrave;m.<br /></td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 2:</span></strong></td>\r\n<td colspan=\"9\" align=\"justify\"><span style=\"font-weight: bold; text-align: start;\">NGUY&Ecirc;N PHỤ LIỆU</span></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\">\r\n<p style=\"text-align: justify; \"><br />&shy;	 - B&ecirc;n  A giao c&aacute;c t&agrave;i liệu kỹ thuật cần thiết, v&agrave; Nguy&ecirc;n Phụ liệu cho b&ecirc;n B tại kho b&ecirc;n A. B&ecirc;n B phải tự kiểm tra nguy&ecirc;n phụ liệu về số lượng, chất lượng, t&ecirc;n h&agrave;ng, k&iacute; hiệu, m&atilde; h&agrave;ng ghi tr&ecirc;n kiện h&agrave;ng v&agrave; chứng từ ngay tại kho b&ecirc;n A. B&ecirc;n B phải chịu tr&aacute;ch nhiệm về nguy&ecirc;n liệu từ khi tiếp nhận đến khi thanh l&yacute; xong hợp đồng. Nếu b&ecirc;n B đ&atilde; nhận h&agrave;ng v&agrave; ph&aacute;t hiện nguy&ecirc;n phụ liệu kh&ocirc;ng đạt số lượng v&agrave; chất lượng, B&ecirc;n B phải giữ lại nguy&ecirc;n tem, nguy&ecirc;n kiện để b&aacute;o ngay cho b&ecirc;n A trong v&ograve;ng 03 ng&agrave;y bằng văn bản để kịp thời giải quyết. Nếu qu&aacute; 05 ng&agrave;y b&ecirc;n B kh&ocirc;ng b&aacute;o cho b&ecirc;n A biết th&igrave; mọi mất m&aacute;t, thiếu hụt b&ecirc;n B chịu tr&aacute;ch nhiệm (trừ thay th&acirc;n, lỗi sợi). B&ecirc;n B kh&ocirc;ng được giao nguy&ecirc;n phụ liệu cho bất kỳ một ai trong bất kỳ điều kiện n&agrave;o khi chưa c&oacute; &yacute; kiến của b&ecirc;n A, nếu kh&ocirc;ng b&ecirc;n B ho&agrave;n to&agrave;n chịu tr&aacute;ch nhiệm bồi thường gi&aacute; trị đơn h&agrave;ng v&igrave; đ&atilde; vi phạm hợp đồng.</p>\r\n<p style=\"text-align: justify; \">- B&ecirc;n B may 02 &aacute;o mẫu cho B&ecirc;n A duyệt trước khi may h&agrave;ng v&agrave; trả lại mẫu gốc cho B&ecirc;n A trong v&ograve;ng 07 ng&agrave;y kể từ ng&agrave;y mượn, nếu qu&aacute; 07 ng&agrave;y B&ecirc;n B kh&ocirc;ng trả lại mẫu gốc cho B&ecirc;n A th&igrave; sẽ bị khấu trừ 1.000.000VND/ mẫu.</p>\r\n<p style=\"text-align: justify; \">- B&ecirc;n B phải sử dụng đ&uacute;ng định mức nguy&ecirc;n phụ liệu đ&atilde; được duyệt. Tỉ lệ hao hụt nguy&ecirc;n liệu: 2%, phụ liệu 1%. Nếu B&ecirc;n B sử dụng qu&aacute; định mức cho ph&eacute;p m&agrave; kh&ocirc;ng được chấp nhận của B&ecirc;n A th&igrave; B&ecirc;n B phải bồi thường theo gi&aacute; nhập khẩu v&agrave; thuế nhập khẩu. &shy;</p>\r\n<p style=\"text-align: justify; \">- Đối với số nguy&ecirc;n phụ liệu thừa B&ecirc;n B phải xuất trả lại cho B&ecirc;n A trong v&ograve;ng 07 ng&agrave;y sau đợt xuất h&agrave;ng cuối c&ugrave;ng. Trong trường hợp B&ecirc;n B kh&ocirc;ng xuất trả đầy đủ số Nguy&ecirc;n phụ liệu thừa đ&oacute; cho B&ecirc;n A th&igrave; hai b&ecirc;n thoả thuận B&ecirc;n B phải chịu tr&aacute;ch nhiệm thanh to&aacute;n số tiền tương ứng theo gi&aacute; FOB.</p>\r\n<p style=\"text-align: justify; \">- B&ecirc;n B phải thực hiện đ&uacute;ng nguy&ecirc;n tắc về ph&ograve;ng ch&aacute;y chữa ch&aacute;y v&agrave; quy định về bảo vệ t&agrave;i sản do nh&agrave; nước ban h&agrave;nh, mọi rủi ro thiệt hại b&ecirc;n B phải chịu bồi thường cho b&ecirc;n A t&ograve;an bộ gi&aacute; trị t&agrave;i sản.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 3:</span></strong></td>\r\n<td colspan=\"9\"><strong>GIAO NHẬN, VẬN CHUYỂN</strong></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\">\r\n<p style=\"text-align: justify; \"><br />- Trước khi xuất h&agrave;ng 04 ng&agrave;y B&ecirc;n B c&oacute; tr&aacute;ch nhiệm giao cho B&ecirc;n A sản phẩm mẫu, bảng định mức Packing List để B&ecirc;n A l&agrave;m thủ tục hải quan -Th&agrave;nh phẩm được đ&oacute;ng g&oacute;i bao b&igrave;, k&iacute; m&atilde; hiệu theo quy định của B&ecirc;n A hoặc hướng dẫn của Kh&aacute;ch h&agrave;ng v&agrave; được giao cho B&ecirc;n A chậm nhất l&agrave; 24h trước khi Hải quan đến để B&ecirc;n A tiến h&agrave;nh l&agrave;m thủ tục kiểm ho&aacute; với hải quan.</p>\r\n<p style=\"text-align: justify; \">- B&ecirc;n B giao th&agrave;nh phẩm nguy&ecirc;n đai, nguy&ecirc;n kiện cho B&ecirc;n A tại kho chỉ định của b&ecirc;n A hoặc tại cảng xuất. -Mọi chi ph&iacute; Nguy&ecirc;n phụ liệu v&agrave; th&agrave;nh phẩm do B&ecirc;n B tự quản. -B&ecirc;n B cung cấp 02 mẫu cho B&ecirc;n A để l&agrave;m thủ tục hải quan xuất h&agrave;ng (h&agrave;ng mẫu kh&ocirc;ng t&iacute;nh tiền gia c&ocirc;ng).</p>\r\n<p>- B&ecirc;n B phải giao đầy đủ chứng từ cho B&ecirc;n A 04 ng&agrave;y trước khi giao h&agrave;ng v&agrave; Ho&aacute; đơn t&agrave;i ch&iacute;nh.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 4:</span></strong></td>\r\n<td colspan=\"9\"><strong>CHẤT LƯỢNG TH&Agrave;NH PHẨM &ndash; QUI C&Aacute;CH Đ&Oacute;NG G&Oacute;I &ndash; NG&Agrave;Y GIAO H&Agrave;NG</strong></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\">\r\n<p style=\"text-align: justify; \"><br />-&nbsp;B&ecirc;n B chịu tr&aacute;ch nhiệm cuối c&ugrave;ng với kh&aacute;ch h&agrave;ng nước ngo&agrave;i về qui c&aacute;ch, mẫu m&atilde;, kỹ thuật, số lượng, chất lượng h&agrave;ng gia c&ocirc;ng th&agrave;nh phẩm, ng&agrave;y giao h&agrave;ng v&agrave; tất cả những khiếu nại, y&ecirc;u cầu bồi thường của Kh&aacute;ch h&agrave;ng nước ngo&agrave;i (nếu c&oacute;) c&ugrave;ng tất cả những vấn đề li&ecirc;n quan đến việc gia c&ocirc;ng h&agrave;ng v&agrave; b&agrave;n giao ho&agrave;n tất. Trường hợp h&agrave;ng đ&atilde; xuất sang nước ngo&agrave;i m&agrave; Kh&aacute;ch h&agrave;ng b&aacute;o lại bằng văn bản: Debit memo (invoice &hellip;) kh&ocirc;ng đạt chất lượng th&igrave; B&ecirc;n A sẽ căn cứ v&agrave;o chứng từ của Kh&aacute;ch h&agrave;ng trừ tiền B&ecirc;n B v&agrave; số tiền đ&oacute; sẽ được cấn trừ trong đợt thanh to&aacute;n tiền gia c&ocirc;ng gần nhất.</p>\r\n<p style=\"text-align: justify; \">-&nbsp;Nếu b&ecirc;n B giao th&agrave;nh phẩm trễ hơn thời gian thỏa thuận trong hợp đồng hoặc h&agrave;ng bị thất tho&aacute;t th&igrave; b&ecirc;n B phải chịu mọi chi ph&iacute; vận chuyển bằng m&aacute;y bay ra nước ngo&agrave;i, c&ugrave;ng ph&iacute; bảo hiểm h&agrave;ng h&oacute;a v&agrave; c&aacute;c khoản tiền phạt, bồi thường thiệt hại cho kh&aacute;ch h&agrave;ng của b&ecirc;n A (trừ trường hợp Nguy&ecirc;n phụ liệu về trễ l&agrave;m ảnh hưởng đến tiến độ sản xuất th&igrave; ng&agrave;y giao h&agrave;ng sẽ được thoả thuận lại).</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 5:</span></strong></td>\r\n<td colspan=\"9\"><strong>PHƯƠNG THỨC THANH TO&Aacute;N:</strong></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\">\r\n<p>&nbsp;-&nbsp;B&ecirc;n A sẽ thanh to&aacute;n cho B&ecirc;n B trong v&ograve;ng 30 ng&agrave;y kể từ ng&agrave;y nhận h&agrave;ng v&agrave; Ho&aacute; đơn GTGT</p>\r\n<p>&nbsp;- Điều kiện thanh to&aacute;n: B&ecirc;n A sẽ thanh to&aacute;n cho B&ecirc;n B sau khi B&ecirc;n B cung cấp đầy đủ c&aacute;c chứng từ sau:&nbsp;</p>\r\n<p style=\"padding-left: 30px; \">+ H&oacute;a đơn GTGT do bộ t&agrave;i ch&iacute;nh ph&aacute;t h&agrave;nh (Bản ch&iacute;nh li&ecirc;n 2)</p>\r\n<p style=\"padding-left: 30px; \">+ Phiếu xuất kho th&agrave;nh phẩm của b&ecirc;n B</p>\r\n<p style=\"padding-left: 30px; \">+ Bi&ecirc;n bản thanh l&yacute; nguy&ecirc;n phụ liệu</p>\r\n<p style=\"padding-left: 30px; \">+ Bảng thanh l&yacute; phụ kiện</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 5:</span></strong></td>\r\n<td colspan=\"9\"><strong>ĐIỀU KHOẢN CHUNG.</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify; \" colspan=\"10\">&nbsp;- Hai b&ecirc;n cam kết thi h&agrave;nh đ&uacute;ng v&agrave; đầy đủ c&aacute;c điều khoản đ&atilde; thỏa thuận trong hợp đồng. Sau khi đồng &yacute; nhận may đơn h&agrave;ng, b&ecirc;n B phải đảm bảo giao h&agrave;ng theo ng&agrave;y đ&atilde; thỏa thuận v&agrave; kh&ocirc;ng được trả lại h&agrave;ng, trường hợp sau khi đ&atilde; k&yacute; hợp đồng B&ecirc;n B trả lại đơn h&agrave;ng, th&igrave; b&ecirc;n B sẽ chịu bồi thường theo đ&uacute;ng gi&aacute; trị l&ocirc; h&agrave;ng. Mọi sự thay đổi, bổ sung đều được x&aacute;c nhận bằng văn &nbsp;bản giữa hai b&ecirc;n.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify; \" colspan=\"10\">&nbsp;- Trong qu&aacute; tr&igrave;nh thực hiện nếu c&oacute; ph&aacute;t sinh vấn đề kh&oacute; khăn n&agrave;o cho một trong hai b&ecirc;n th&igrave; phải c&ugrave;ng nhau b&agrave;n bạc giải quyết tr&ecirc;n tinh thần hợp t&aacute;c nhằm thực hiện tốt hợp đồng đ&atilde; k&yacute; kết.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify; \" colspan=\"10\">&nbsp;- Nếu việc tranh chấp HĐ kh&ocirc;ng giải quyết được th&igrave; hai b&ecirc;n đồng &yacute; đưa vụ tranh chấp ra To&agrave; &aacute;n Kinh tế TP. Hồ Ch&iacute; Minh để giải quyết. Quyết định của To&agrave; &aacute;n l&agrave; quyết định cuối c&ugrave;ng. Ph&iacute; To&agrave; &aacute;n do b&ecirc;n thua kiện chịu.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify; \" colspan=\"10\">&nbsp;- Hợp đồng n&agrave;y đựơc lập th&agrave;nh 04 (bốn) bản, mỗi b&ecirc;n giữ 02 (hai) bản v&agrave; c&oacute; gi&aacute; trị ph&aacute;p l&yacute; ngang nhau kể từ ng&agrave;y k&yacute; v&agrave; c&oacute; gi&aacute; trị đến hết ng&agrave;y  #endday#/#endmonth#/#endyear#.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 700px;\" border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"30\">&nbsp;</td>\r\n<td width=\"80\">&nbsp;</td>\r\n<td width=\"55\">&nbsp;</td>\r\n<td width=\"85\">&nbsp;</td>\r\n<td width=\"28\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><strong>ĐẠI DIỆN B&Ecirc;N A<br /> </strong></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><strong>ĐẠI DIỆN B&Ecirc;N B<br /> </strong></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><em>(K&yacute; t&ecirc;n)</em></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div style=\"text-align: center;\"><em>(K&yacute; t&ecirc;n)</em></div>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td colspan=\"3\">\r\n<div styl