<td width=\"108\">&nbsp;</td>\r\n<td width=\"31\">&nbsp;</td>\r\n<td width=\"59\">&nbsp;</td>\r\n<td width=\"66\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 1:</span></strong></td>\r\n<td colspan=\"9\"><strong>NỘI DUNG HỢP ĐỒNG</strong></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\"><!--strAttack--></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\"><br />\r\n<p>-<span style=\"white-space:pre\"> </span>Ch&acirc;́t lượng v&agrave; đ&oacute;ng g&oacute;i:</p>\r\n<p>Ch&acirc;́t lượng: Mức đ&ocirc;̣ dung sai (+-) 1cm ( 80% mức đ&ocirc;̣ m&agrave;u sắc)</p>\r\n<p>Đ&oacute;ng g&oacute;i: B&ecirc;n B tự đ&oacute;ng g&oacute;i sản ph&acirc;̉m - bao b&igrave; do b&ecirc;n A cung c&acirc;́p</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 2:</span></strong></td>\r\n<td colspan=\"9\" align=\"justify\"><span style=\"font-weight: bold; text-align: start;\">THỜI GIAN V&Agrave; PHƯƠNG THỨC GIAO H&Agrave;NG</span></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"10\"><br />\r\n<p style=\"padding-left: 30px;\">1. Thời gian giao h&agrave;ng: phụ thu&ocirc;̣c v&agrave;o đơn h&agrave;ng sau khi duy&ecirc;̣t m&acirc;̃u k&iacute; hợp đ&ocirc;̀ng v&agrave; nh&acirc;̣n ti&ecirc;̀n đặt cọc</p>\r\n<p style=\"padding-left: 30px;\">2. S&ocirc;́ lượng 500 &aacute;o/ đơn h&agrave;ng, thời hạn trong v&ograve;ng 15 ng&agrave;y t&iacute;nh từ ng&agrave;y k&iacute; hợp đ&ocirc;̀ng</p>\r\n<p style=\"padding-left: 30px;\">3. Địa đi&ecirc;̉m giao h&agrave;ng tại địa chỉ: 02/01 Đ&ocirc;̃ Thừa Tự, P T&acirc;n Qu&yacute;, Q T&acirc;n Ph&uacute;, TPHCM</p>\r\n<p style=\"padding-left: 30px;\">4. B&ecirc;n A cam k&ecirc;́t kh&ocirc;ng nh&acirc;̣n gia c&ocirc;ng m&acirc;̃u h&agrave;ng do b&ecirc;n B đặt cho b&acirc;́t k&igrave; c&aacute; nh&acirc;n ngo&agrave;i b&ecirc;n B</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 3:</span></strong></td>\r\n<td colspan=\"9\"><strong>PHƯƠNG THỨC THANH TO&Aacute;N</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify;\" colspan=\"10\"><br />\r\n<p style=\"padding-left: 30px;\">1. Đặt cọc 30% gi&aacute; trị hợp đ&ocirc;̀ng khi k&iacute; hợp đ&ocirc;̀ng</p>\r\n<p style=\"padding-left: 30px;\">2. Khi giao nh&acirc;̣n h&agrave;ng v&agrave; ki&ecirc;̉m h&agrave;ng đ&acirc;̀y đủ s&ocirc;́ lượng v&agrave; ch&acirc;́t lượng như trong hợp đ&ocirc;̀ng, B&ecirc;n B thanh to&aacute;n th&ecirc;m 20% gi&aacute; trị hợp đ&ocirc;̀ng, 50% gi&aacute; trị hợp đ&ocirc;̀ng c&ograve;n lại b&ecirc;n B thanh to&aacute;n cho b&ecirc;n A trong v&ograve;ng 15 đ&ecirc;́n 30 ng&agrave;y t&iacute;nh từ ng&agrave;y nh&acirc;̣n đủ đơn h&agrave;ng&nbsp;</p>\r\n<p style=\"padding-left: 30px;\">3. Thanh to&aacute;n bằng ti&ecirc;̀n mặt hoặc chuy&ecirc;̉n khoản</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 4:</span></strong></td>\r\n<td colspan=\"9\"><strong>KHIẾU NẠI V&Agrave; TRỌNG T&Agrave;I</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify;\" colspan=\"10\"><br />\r\n<p style=\"padding-left: 30px;\">1. B&ecirc;n B c&oacute; b&acirc;́t cứ khi&ecirc;́u nại n&agrave;o phải được vi&ecirc;́t bằng văn bản trong v&ograve;ng 07 ng&agrave;y t&iacute;nh từ ng&agrave;y nh&acirc;̣n h&agrave;ng</p>\r\n<p style=\"padding-left: 30px;\">2. Cả 02 b&ecirc;n thực hi&ecirc;̣n m&ocirc;̣t c&aacute;ch nghi&ecirc;m chỉnh c&aacute;c đi&ecirc;̀u khoản trong hợp đ&ocirc;̀ng, kh&ocirc;ng đơn phương thay đ&ocirc;̉i hoặc hủy bỏ hợp đ&ocirc;̀ng th&igrave; hợp đ&ocirc;̀ng xem như kh&ocirc;ng c&oacute; gi&aacute; trị</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong><span style=\"text-decoration: underline;\">ĐIỀU 6:</span></strong></td>\r\n<td colspan=\"9\"><strong>ĐIỀU KHOẢN CHUNG.</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: justify; \" colspan=\"10\"><br />\r\n<p style=\"padding-left: 30px;\">1. Trong qu&aacute; tr&igrave;nh thực hi&ecirc;̣n hợp đ&ocirc;̀ng n&agrave;y, t&acirc;́t cả những tranh c&atilde;i sẽ được giải quy&ecirc;́t tr&ecirc;n tinh th&acirc;̀n hữu nghị hợp t&aacute;c</p>\r\n<p style=\"padding-left: 30px;\">2. N&ecirc;́u c&oacute; b&acirc;́t k&igrave; thay đ&ocirc;̉i g&igrave; trong hợp đ&ocirc;̀ng n&agrave;y sẽ được thực hi&ecirc;̣n bởi phụ lục hợp đ&ocirc;̀ng v&agrave; hai b&ecirc;n c&ugrave;ng k&iacute;</p>\r\n<p style=\"padding-left: 30px;\">3. Hợp đ&ocirc;̀ng n&agrave;y được l&acirc;̣p th&agrave;nh 02 bản, m&ocirc;̃i b&ecirc;n giữ 01 bản v&agrave; c&oacute; g&iacute;a trị ph&aacute;p l&yacute; như nhau</p>\r\n<p style=\"padding-left: 30px;\">4. Sau khi thanh to&aacute;n đủ gi&aacute; trị hợp đ&ocirc;̀ng, th&igrave; hợp đ&ocirc;̀ng được thanh l&yacute;</p>\r\n<p style=\"padding-left: 30px;\">5. Hợp đ&ocirc;̀ng c&oacute; hi&ecirc;̣u lực k&ecirc;̉ từ ng&agrave;y k&iacute;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 700px;\" border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<t